void solve() {
    string s; cin >> s;
    int cnt[256] = {0};
    for (int i = 0; i < sz(s); i++)
        cnt[s[i]]++;
    
    vector<char> ans(s.size());

    int countOdd = 0;
    int left = 0, right = s.size() -1;
    bool check = 1;

    if(sz(s) & 1){
        for (int i = 0; i < sz(s); i++)
        {
            if(cnt[s[i]] & 1) {
                countOdd++;
            }
        }

        if (countOdd % 2 != 1) check = 0; 
        else {
            

            for (int i = 0; i < sz(s); i++) {
                while (cnt[s[i]] >= 2) {
                    ans[left] = s[i];
                    ans[right] = s[i];
                    left++;
                    right--;
                    cnt[s[i]] -= 2;
                    dbg(left, right,ans);
                }
            }
        }
        
    }
    else {
        for (int i = 0; i < sz(s); i++) {
            if(cnt[s[i]] & 1) {
                check = 0;
                break;
            }
        }
        for (int i = 0; i < sz(s); i++) {
            while (cnt[s[i]] >= 2) {
                ans[left] = s[i];
                ans[right] = s[i];
                left++;
                right--;
                cnt[s[i]] -= 2;
            }
        }
    }
    if(check) for(char &x : ans) cout << x;
    else cout << "NO SOLUTION" << endl;
}   

